import './App.css';
import Header from "./components/Header.js";
import Movie from "./components/Movie.js";
import movies from "./movie.json";

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Header />
      <div className="main">
      {
        movies.map=(element)=>{
          <Movie
          title={element.Title}
          year={element.Year}
          img={element.Poster}
          />
        }
      }
      </div>
      </header>
    </div>
  );
}

export default App;
